const Particle ={ 
	particles: {
		number:{
			value:30,
			density:{
				enable:true,
				value_area:800
			}
		}
		}
	}   
class App extends Component {
	constructor(){
		super();
		this.state = {
			input:'' ,
			imageUrl:''
		}
	}
	onInputChange =(event)=>{
		console.log(event.target.value);
	}
	onButtonSubmit =()=>{
	app.models.predict("17c4369faa394932aff6e35ae8dfe073", "https://samples.clarifai.com/face-det.jpg").then(
      function(response) {
      // do something with response
       },
       function(err) {
      // there was an error
       }
  );
	}
    render() {
    return (
      <div className="App">
       <Particles className='particles'
        params={Particle} />
       <Navigation />
       <Logo />
       <Rank />
       <SearchBox
        onInputChange={this.onInputChange} 
        onButtonSubmit={this.onButtonSubmit}
       />



      </div>
    );
  }
}

export default App;
